import ReactModal from 'react-modal';

function ClassCard ( { name } ) {

    const [ isOpen, setIsOpen ] = useState( false );

    return (
        <div>
            <ReactModal
                isOpen = { isOpen }
                contentLabel = "Test"
                onRequestClose = { () => setIsOpen( false ) }
                >
                    <button></button>
                </ReactModal>
        </div>
    ) ;
}

export default ClassCard;
